export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},t13bZ9Iw4A:{data:{id:199,attributes:{imdbId:"tt0112435",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNWY3MmIxYTItY2RhMy00ZGRkLTkwMTEtZGE0OTcxMjgxN2U3XkEyXkFqcGdeQXVyNTM5NzI0NDY@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"5.8\u002F10"},{Source:"Rotten Tomatoes",Value:"67%"},{Source:"Metacritic",Value:"48\u002F100"}],item_lang:{data:{id:862,attributes:{title:"The Baby-Sitters Club",plot:"When Kristy Thomas, president of The Baby-Sitters Club, has a brilliant idea to run a summer day camp, the girls all agree it's the perfect way to spend their summer together. But life gets complicated as budding romance, family problems, and three rival teen girls conspire to ruin the club, all putting the friendships between the members to the test.",slug:"the-baby-sitters-club"}}},books:{data:[{id:506,attributes:{title:"Logan Likes Mary Anne!: A Graphic Novel (The Baby-sitters Club #8)",description:"Another Baby-sitters Club graphic novel adapted by New York Times bestselling author Gale Galligan! It's the first day of a new school year, and while Mary Anne doesn't know what to expect from the eighth grade, she's looking forward to getting back into the swing of things. One thing she definitely doesn't expect is to meet Logan Bruno, who just moved to Stoneybrook!Logan has a dreamy southern accent, he's awfully cute... and he might be interested in joining the BSC. But the baby-sitters aren't sure if Logan would make a good club member, so they send him on a job with Mary Anne as a test. Logan and Mary Anne hit it off, but Mary Anne isn't sure of where their friendship could go. Life in the Baby-sitters Club has never been this complicated -- or this fun!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gWW_DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:h,publisher:e,subtitle:b}},{id:507,attributes:{title:"The Baby-Sitters Club #1: Kristy's Great Idea",description:"The hit series returns to charm and inspire another generation of baby-sitters! The first three classic BSC books are back, along with a brand-new prequel, The Summer Before. It all began with a great idea ... and the inspiring original story of the Baby-sitters Club is back! Kristy Thomas's brilliant business plan gets off to a great start with the help of Claudia Kishi (vice-president), Mary Anne Spier (secretary), and Stacey McGill (treasurer).",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zJqpdDVLy_YC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:i,publisher:e,subtitle:b}},{id:508,attributes:{title:"Stacey's Mistake",description:"America's favorite series returns with a new look and a Netflix tv show. Stacey's so excited! She's invited her friends from the Baby-sitters Club down to New York City for a long weekend. It's going to be perfect-a party and a sleepover Friday night, a big baby-sitting job on Saturday, and lots of sightseeing on Sunday. But what a mistake! The Baby-sitters are way out of place in the big city. Mary Anne sounds like a walking guide book; Dawn's afraid of everything; Kristy can't keep her mouth shut; and Claudia's jealous of Stacey's friends. Does this mean Stacey can't be the Baby-sitters' friend anymore? Will the Baby-sitters Club fall apart?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_IsOzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2021-11-02",publisher:j,subtitle:b}},{id:509,attributes:{title:"Logan Likes Mary Anne!",description:"A new boy in school, Logan Bruno, wants to join the Baby-sitters Club, while Mary Anne finds her feelings for Logan are complicated, to say the least.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=cKLqywEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:h,publisher:j,subtitle:b}},{id:510,attributes:{title:"The Baby-Sitters Club #2: Claudia and the Phantom Phone Calls",description:"The hit series returns to charm and inspire another generation of baby-sitters! The first three classic BSC books are back, along with a brand-new prequel, The Summer Before. Being a good baby-sitter isn't always easy, and the vice-president of the Baby-Sitters Club, Claudia Kishi, is learning that the hard way. She and the other club members have started getting strange calls on the job. Is it the Phantom Caller, a jewel thief who's been breaking into houses in the area? One thing is certain -- the Club has to take action to protect their kids!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ZwGb7Q9KWgQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:i,publisher:e,subtitle:b}}]}}},meta:{}}},prerenderedAt:1681309139504}}("Ann M. Martin","","movie",null,"Scholastic Inc.","series",1,"2020-09-01","2011-10-01","Baby-Sitters Club"))